css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

A.new_post_label > I {height: 90px}
.new_post_label > I {
  color: transparent !important;
  transition: background-position .08s linear !important;
}

.new_post_label {
  padding: 79px 1px 0px 0 !important;
  text-transform: lowercase;
  font-size: 10pt !important;
  color: black !important;
  font-weight: bold !important;
}

.new_post_label/*_icon*/ > I {
  background: url('data:image/png;base64,') no-repeat !important;
  z-index: -1;
}

.new_post_label:nth-of-type(1) > I {background-position: 2px 4px !important}
.new_post_label:nth-of-type(2) > I {background-position: -73px 4px !important}
.new_post_label:nth-of-type(3) > I {background-position: -148px 4px !important}
.new_post_label:nth-of-type(4) > I {background-position: -223px 4px  !important}
.new_post_label:nth-of-type(5) > I {background-position: -298px 4px !important}
.new_post_label:nth-of-type(6) > I {background-position: -373px 4px !important}
.new_post_label:nth-of-type(7) > I {background-position: -448px 4px  !important}

.new_post_label:nth-of-type(1):hover > I {background-position: 2px 0px !important}
.new_post_label:nth-of-type(2):hover > I {background-position: -73px 0px !important}
.new_post_label:nth-of-type(3):hover > I {background-position: -148px 0px !important}
.new_post_label:nth-of-type(4):hover > I {background-position: -223px 0px  !important}
.new_post_label:nth-of-type(5):hover > I {background-position: -298px 0px !important}
.new_post_label:nth-of-type(6):hover > I {background-position: -373px 0px  !important}
.new_post_label:nth-of-type(7):hover > I {background-position: -448px 0px  !important}

}
